import beesoul from '../Assests/beesoul.png';
import {Link} from 'react-router-dom';



const Navbar = () => {

  return (
    <div> 
      <a className='' href='/'> <img className='ml-10 py-5' src={beesoul} alt =""/>  </a>
      <ul>
        <li><Link to="/">Home</Link></li>
      </ul>
    </div>
  )
}

export default Navbar
